# We can quickly change the style of the figure to a different theme with only a single line of code.  

# CELL ********************

# Change the style of the figure to the "dark" theme
sns.set_style("dark")

# Line chart 
plt.figure(figsize=(12,6))
sns.lineplot(data=spotify_data)

